import axios from "axios";

const API_URL = "http://localhost:8080/users/";

const register = (username, email, password) => {
    return axios.post(API_URL + "signup", {
      username,
      email,
      password,
    });
  };
  const AuthService = {
    register
  }

export default AuthService;
